import Button from './Button';
import './Pocket.css';
function Pocket(){
    return(
     <div className="Pocket">
     <div className="wrap">
     <h2>
     Restaurants in your pocket
     </h2>
     <p>Order from your favorite restaurants & track on the go, with the all-new Swiggy app.</p>
     <Button />
     </div>
     </div>
    )
}
export default Pocket;
